CREATE DATABASE FANTASY;
USE FANTASY;

CREATE TABLE Data (
    Id VARCHAR(11) CHARACTER SET utf8,
    Position VARCHAR(2) CHARACTER SET utf8,
    First_Name VARCHAR(10) CHARACTER SET utf8,
    Last_Name VARCHAR(14) CHARACTER SET utf8,
    FPPG NUMERIC(11, 9),
    Played INT,
    Salary INT,
    Game VARCHAR(7) CHARACTER SET utf8,
    Team VARCHAR(3) CHARACTER SET utf8,
    Opponent VARCHAR(3) CHARACTER SET utf8,
    Injury_Indicator VARCHAR(3) CHARACTER SET utf8,
    Injury_Details VARCHAR(11) CHARACTER SET utf8,
    Probable_Pitcher VARCHAR(3) CHARACTER SET utf8,
    Batting_Order INT
);

